import React from 'react';
import { Link } from 'react-router-dom';

const About = () => {
  return (
    <>
      <div>About</div>
      <ul>
        <li>
          <Link to="/">Go to Home</Link>
        </li>
      </ul>
    </>
  );
};

export default About;
